INSERT INTO `tbl_faq` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(1, 'How do I register?', 'You can register by clicking on the "Sign up" button. Please provide the information in the form that appears. You can review the terms and conditions, and submit the registration information. You can register by clicking on the "Sign up" button. Please provide the information in the form that appears. You can review the terms and conditions, and submit the registration information. You can register by clicking on the "Sign up" button. Please provide the information in the form that appears. You can review the terms and conditions, and submit the registration information.', '2020-12-18 18:29:22', '2020-12-19 00:10:24'),
(2, 'Are there any charges for registration?', 'No. Registration on GNG is absolutely free.', '2020-12-18 18:29:22', NULL),
(3, 'Do I have to necessarily register to shop on GNG?', 'You can surf and add products to the cart without registration but only registered shoppers will be able to checkout and place orders. Registered members have to be logged in at the time of checking out the cart, they will be prompted to do so if they are not logged in.', '2020-12-18 18:29:22', NULL);
