(20, 'FDFC08D8', 'Fresh Mint', '<h1 class="css-1jisqi6" style="-webkit-font-smoothing: antialiased; box-sizing: inherit; font-family: &quot;Proxima Nova Condensed&quot;, system-ui, sans-serif; font-size: 50px; line-height: 54px; margin-bottom: 30px; color: rgb(35, 31, 32);">8 Health Benefits of Mint</h1><div style="-webkit-font-smoothing: antialiased; box-sizing: inherit; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, system-ui, sans-serif; font-size: 18px;"><article class="article-body css-d2znx6 undefined" style="-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px;"><div class="css-0" style="-webkit-font-smoothing: antialiased; box-sizing: inherit;"><span style="-webkit-font-smoothing: antialiased; box-sizing: inherit; font-size: 0px; line-height: 0;"></span><h2 class="css-13i30ag" style="-webkit-font-smoothing: antialiased; box-sizing: inherit; position: relative; clear: both; font-size: 38px; line-height: 42px; margin-bottom: 15px; padding-top: 0px;"><div style="-webkit-font-smoothing: antialiased; box-sizing: inherit;"><a name="TOC_TITLE_HDR_1" style="-webkit-font-smoothing: antialiased; box-sizing: inherit;"></a><a class="css-5r4717" target="_blank" rel="noopener noreferrer" name="" style="-webkit-font-smoothing: antialiased; box-sizing: inherit; border-color: currentcolor; color: rgb(1, 173, 185);"></a></div></h2><div class="content_body" id="TOC_TITLE_1" style="-webkit-font-smoothing: antialiased; box-sizing: inherit;"><p style="-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; line-height: 26px;">Mint is the name for over a dozen plant species, including peppermint and spearmint, that belong to the genus&nbsp;<em style="-webkit-font-smoothing: antialiased; box-sizing: inherit;">Mentha</em>.</p><p style="-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; line-height: 26px;">These plants are particularly known for the cooling sensation they impart. They can be added to foods in both fresh and dried forms.</p></div></div></article></div>', 'product_644.png', 1, '6', NULL, '2020-12-14 05:11:53', NULL),
(21, 'C5A902C6', 'Fresh Basil', '<p style="box-sizing: inherit; margin-right: 0px; margin-bottom: 1.125rem; margin-left: 0px; line-height: 1.875rem; color: rgb(77, 77, 77); font-family: Roboto, Verdana, sans-serif; font-size: 19px; letter-spacing: -0.273104px;">Originally native to India, Asia, and Africa, basil was held to be a sacred and noble herb. In fact, the word “basil” comes from the ancient Greek “basilikhon” which means “royal”.</p><p style="box-sizing: inherit; margin-right: 0px; margin-bottom: 1.125rem; margin-left: 0px; line-height: 1.875rem; color: rgb(77, 77, 77); font-family: Roboto, Verdana, sans-serif; font-size: 19px; letter-spacing: -0.273104px;">Today, Ocimum basilicum (the scientific name for basil) grows in many places around the world. Many people even grow basil in their kitchens or gardens. This fragrant herb is used as a seasoning in a variety of dishes, and plays a key role in Italian and Thai cuisine.</p><p style="box-sizing: inherit; margin-right: 0px; margin-bottom: 1.125rem; margin-left: 0px; line-height: 1.875rem; color: rgb(77, 77, 77); font-family: Roboto, Verdana, sans-serif; font-size: 19px; letter-spacing: -0.273104px;"><span style="letter-spacing: -0.273104px;">Basil contains many vitamins and minerals, as well as antioxidants such as&nbsp;</span><a href="https://www.webmd.com/eye-health/lutein-zeaxanthin-vision" data-metrics-link="" style="box-sizing: inherit; transition-duration: 150ms; transition-property: color; color: var(--sf-secondary-b, #b5b5b5); background-color: rgb(255, 255, 255); font-weight: bold; letter-spacing: -0.273104px;">lutein</a><span style="letter-spacing: -0.273104px;">, zeaxanthin,&nbsp;</span><a href="https://www.webmd.com/vitamins-and-supplements/beta-carotene#1" data-metrics-link="" style="box-sizing: inherit; transition-duration: 150ms; transition-property: color; color: var(--sf-secondary-b, #b5b5b5); background-color: rgb(255, 255, 255); font-weight: bold; letter-spacing: -0.273104px;">beta-carotene</a><span style="letter-spacing: -0.273104px;">, and beta-cryptoxanthin. Many of basil’s health benefits come from these antioxidants, as well as its&nbsp;</span><a href="https://www.webmd.com/arthritis/qa/how-do-i-use-essential-oils" data-metrics-link="" style="box-sizing: inherit; transition-duration: 150ms; transition-property: color; color: var(--sf-secondary-b, #b5b5b5); background-color: rgb(255, 255, 255); font-weight: bold; letter-spacing: -0.273104px;">essential oils</a><span style="letter-spacing: -0.273104px;">. These compounds mostly disappear during the drying process, so opt for fresh basil whenever possible to gain the most benefits.</span><br></p>', 'product_314.png', 1, '6', NULL, '2020-12-14 05:13:56', '2020-12-14 17:12:57');
